import Rectangle from "./components/Rectangle";
import Block from "./components/Block";
import BlockChange from "./components/BlockChange";

function App() {
  return (
    <div className="App">

          <Rectangle/>
          <Rectangle/>
          <Rectangle/>

          <Block baColor={"gray"} boColor={"black"}/>

          <BlockChange/>

          <Block baColor={"yellow"} boColor={"orange"}/>

          <BlockChange/>

          <Block baColor={"pink"} boColor={"blue"}/>

          <BlockChange/>

    </div>
  );
}

export default App;
